So far, our app isn't really "doing" anything – in fact, it won't even respond if we try to close it with the "x" button. To handle input from the user, we must use the event loop. Let's edit main to handle events instead of doing nothing with loop {}: fn main() { let event_loop = EventLoop::new(); let context = create_window(&event_loop); let renderer = OpenGl::new_from_glutin_context(&context).expect("Cannot create renderer"); let mut canvas = Canvas::new(renderer).expect("Cannot create canvas"); render(&context, &mut canvas); event_loop.run(|event, _target, control_flow| match event { Event::WindowEvent { window_id, event } => { println!("{:?}", event) } _ => {} })
} event_loop.run will call the provided closure for each new event, until the program exits. Event is the first parameter of the closure, and the one we are most interested in. It is an enum with a few branches for different types of events. In the example above, we only capture and print WindowEvents, and ignore the rest. Each Event::WindowEvent contains: A WindowId – but since we only have 1 window in this example, the ID will always match with our window's ID. A WindowEvent enum, which contains information about the window event. Note: Event::WindowEvent is a branch of the Event enum, which contains another enum, WindowEvent, of the same name! It can get confusing, but Rust namespaces distinguish between the two – one is glutin::event::Event::WindowEvent and the other is glutin::event::WindowEvent. You can run the example to see the different types of WindowEvents being printed as you interact with the window! You might see something like: CursorMoved { device_id: DeviceId(X(DeviceId(2))), position: PhysicalPosition { x: 931.1624145507813, y: 270.08074951171875 }, modifiers: (empty) }
