So far, our code only renders the window once – after that, there's no rendering, only event handling. But suppose we wanted the red square to follow the mouse. How can we re-render the square in the new position? We'll need to re-render every time the mouse position changes. The correct way to do this is to request_redraw , so that the platform knows we want to draw some new stuff. Then, we'll receive a Event::RedrawRequested event, and that's when we can render a new frame: let mut mouse_position = PhysicalPosition::new(0., 0.);
event_loop.run(move |event, _target, control_flow| match event { Event::WindowEvent { window_id, event } => match event { WindowEvent::CursorMoved { position, .. } => { mouse_position = position; context.window().request_redraw(); } // ... }, Event::RedrawRequested(_) => { render(&context, &mut canvas, mouse_position); } _ => {}
}) Finally, we should update our render function to take the mouse position into account – we can just use those coordinates for the square position: fn render<T: Renderer>( context: &ContextWrapper<PossiblyCurrent, Window>, canvas: &mut Canvas<T>, square_position: PhysicalPosition<f64>,
) { //... canvas.clear_rect( square_position.x as u32, square_position.y as u32, 30, 30, Color::rgbf(1., 0., 0.), ); //...
} Our code runs! There's just one small problem... Screenshot of a window: a trail of blocky red paint on a black background, with the cursor at the end of it What happened? Since there's no code to "erase" the old square, all the squares pile up on each other, creating a red mess. To fix this, we should clear the entire window before rendering anything new. canvas.clear_rect(0, 0, size.width, size.height, Color::black()); Now, if you run the code, the red square will happily follow the cursor wherever it goes. Screenshot of a window: red square at the cursor position on a black background To recap, here's the code we've written: use femtovg::renderer::OpenGl;
use femtovg::{Canvas, Color, Renderer};
use glutin::dpi::{PhysicalPosition, PhysicalSize};
use glutin::event::{Event, WindowEvent};
use glutin::event_loop::{ControlFlow, EventLoop};
use glutin::window::{Window, WindowBuilder};
use glutin::{ContextBuilder, ContextWrapper, PossiblyCurrent}; fn main() { let event_loop = EventLoop::new(); let context = create_window(&event_loop); let renderer = OpenGl::new_from_glutin_context(&context).expect("Cannot create renderer"); let mut canvas = Canvas::new(renderer).expect("Cannot create canvas"); let mut mouse_position = PhysicalPosition::new(0., 0.); event_loop.run(move |event, _target, control_flow| match event { Event::WindowEvent { event, .. } => match event { WindowEvent::CursorMoved { position, .. } => { mouse_position = position; context.window().request_redraw(); } WindowEvent::CloseRequested => *control_flow = ControlFlow::Exit, _ => {} }, Event::RedrawRequested(_) => { render(&context, &mut canvas, mouse_position); } _ => {} })
} fn create_window(event_loop: &EventLoop<()>) -> ContextWrapper<PossiblyCurrent, Window> { let window_builder = WindowBuilder::new() .with_inner_size(PhysicalSize::new(1000., 600.)) .with_title("Femtovg"); let context = ContextBuilder::new() .with_vsync(false) .build_windowed(window_builder, &event_loop) .unwrap(); let current_context = unsafe { context.make_current().expect("Could not make the context current") }; current_context
} fn render<T: Renderer>( context: &ContextWrapper<PossiblyCurrent, Window>, canvas: &mut Canvas<T>, square_position: PhysicalPosition<f64>,
) { // Make sure the canvas has the right size: let window = context.window(); let size = window.inner_size(); canvas.set_size(size.width, size.height, window.scale_factor() as f32); canvas.clear_rect(0, 0, size.width, size.height, Color::black()); // Make smol red rectangle canvas.clear_rect( square_position.x as u32, square_position.y as u32, 30, 30, Color::rgbf(1., 0., 0.), ); // Tell renderer to execute all drawing commands canvas.flush(); // Display what we've just rendered context.swap_buffers().expect("Could not swap buffers");
}
